style.css:
@-moz-document domain("roblox.com") {
.ad, .ad *, .img_ad, .ad-annotations, #google_image_div, #aw0, #AdvertisingLeaderboard
  {
    display: none !important;
  }
  .navigation .notification-icon, .rbx-highlight
  {
    background: #d1b905;
  }

  #header
  {
    background: #d1b905;
  }

  .slide-item-container-left, .profile-avatar-right
  {
    background: #d1b905;
  }

  .rbx-tabs-horizontal .rbx-tab.active .rbx-tab-heading, .rbx-tabs-horizontal .rbx-tab-heading:hover, .rbx-tabs-horizontal .rbx-tab-heading:focus, .rbx-tabs-horizontal .rbx-tab-heading:active
  {
    box-shadow: 0 -4px 0 .6 #d1b905 inset;
  }

  .forum-table-header, body .forum-table-header th, body .forum-table-footer, #ctl00_cphRoblox_Message1_ctl00_CenterColumn > table > tbody > tr:nth-child(1) > th, #ctl00_cphRoblox_CenterColumn > table > tbody > tr:nth-child(1) > th
  {
    background: #d1b905 !important;
  }

  .rbx-upgrade-now #upgrade-now-button, .rbx-btn-secondary-xs.btn-more, #AjaxCommentsContainer > div > div.comment-form > form > button, .rbx-vip-server-create, .btn-secondary-xs
  {
    background-color: #d1b905 !important;
    border-color: #d1b905;
      /*Updrade button*/
    ;
  }

  .rbx-upgrade-now #upgrade-now-button:hover, .rbx-btn-secondary-xs.btn-more:hover, #AjaxCommentsContainer > div > div.comment-form > form > button:hover, .rbx-vip-server-create:hover, .btn-secondary-xs:hover
  {
    background: #d1b905 !important;
    border-color: #d1b905;
  }

  /* Code from DittoDino, I don't want to steal codes without credit :) */
  .btn-common-play-game-lg
  {
  animation: colour-change 5s linear infinite;
  }
  @keyframes colour-change
   {
  0% {background-color: #fae22a; border-color: #fae22a;}

  14% {background-color: #eacf06; border-color: #eacf06;}

  42% {background-color: #b8a305; border-color: #b8a305;}

  56% {background-color: #b8a305; border-color: #b8a305;}

  80% {background-color: #eacf06; border-color: #eacf06;}

  100% {background-color: #fae22a; border-color: #fae22a;}

   }

  .chat-body, .chat-friend, .chat-windows-header
   {
     background-color:#d1b905!important;
     color:#ffffff!important;
   }

  #navbar-search-input, #navbar-search-btn
  {
    border: 1px solid #d1b905;
    ;
  }

  body
  {
    background: transparent !important;
  }

  .content
  {
    background: transparent !important;
  }

  .container-footer
  {
    position: static;
  }

  html
  {
    width: 100% !important;
    height: 100% !important;
    background-size: cover !important;
    background-attachment: fixed !important;
    background-image: url(data:image/jpeg;base64,) !important;
  }

  #party_none_title, div.friend_dock_chatbox_titlebar.chat-header-blink-off
  {
    background: linear-gradient(to bottom, #d1b905, #d1b905);
  }

  #ctl00_cphRoblox_RightColumn, #Body > table > tbody > tr > td:nth-child(3), #Body > table > tbody > tr > td:nth-child(4)
  {
    display: none;
  }

  #GamesPageLeftColumn
  {
    width: auto;
    margin-right: 10px !important;
    margin-left: 10px !important;
  }

  #GamesListsContainer > div
  {
    background-color: transparent !important;
    width: 100% !important;
  }

  #navigation
  {
    background-color: #d1b905;
  }

  .rbx-btn-primary-lg
  {
    background-color: #d1b905;
  }

  .rbx-btn-primary-lg:hover, .rbx-btn-primary-lg:focus
  {
    background-color: #d1b905;
  }

  /* Not needed to save size */
  
  /*
  .avatar-back
  {
    background-image: url(https://wallpaperaccess.com/full/2200179.jpg);
  }
  */
  
  /* Not needed to save size */

  .notification-blue
  {
    background-color: #d1b905;
  }

  body
  {
    background-color: #d1b905;
    color: #d1b905;
    font-family: serif;
    font-weight: 300;
    font-size: 16px;
    width: 100%;
    height: 100%;
    min-width: 320px;
    margin-bottom: 168px;
    overflow-y: scroll;
  }

  .dialog-container .dialog-message-container .dialog-message
  {
    background-color: #d1b905;
    border: 1px solid #d1b905;
    color: #000000;
  }
  .dialog-container .dialog-header
  {
    background-color: #d1b905;
    color: #000000;
  }
  .chat-windows-header
  {
    background-color: #d1b905;
    color: #000000;
  }
  .dialog-container .dialog-message-container.message-cluster-master .dialog-triangle:after, .dialog-container .dialog-message-container.message-cluster-master .dialog-triangle:before 
  {
    border-color: transparent transparent transparent #ecebec;
  }
  .section-content
  {
    background-color: #d1b905;
    padding: 15px;
    position: relative;
  }
}
